import React from 'react';
import ReactDOM from 'react-dom';
import MenuItem from '../../General/MenuItem/MenuItem';
import MenuJSON from '../../../Json/FooterItems';
import './Footer.css'

class Footer extends React.Component {
  render(){
    const MenuItems= MenuJSON.map((jsonItem) =>
    <MenuItem item={jsonItem}/>
  );

return (
<>
<div id="footer" class="container-fluid "  >  
{/* data-aos="zoom-in-right" data-aos-duration="1500" */}
  <div class="separator">
    <div class="square "> </div>
    <div class="hr_1 container-fluid"></div>
  </div>

  <div id="aboutUs" class="txtFont text-center pt-1">
    <h2 class="mt-4 "> About Us </h2>
    <h5 class="mt-4">- Your home is a reflection of your soul -</h5>
    <p class="mt-3">Hi, my name is Aya Saad, I’m 24 years old.
      <br/> I started my journey in two years and accomplished more than 20 projects.
      <br/>My mission is transforming your dream house into reality.
      <br/> providing high quality design, thoughtful imagination and focusing on the smallest details.
    </p>
  </div>

  <ul className=" list-inline text-center pt-5 mt-5 pb-3">
  {MenuItems}
  </ul>
</div>
</> 
);
  }
}

export default Footer;
